import {
    Modal,
    ModalOverlay,
    ModalContent,
    ModalHeader,
    ModalFooter,
    ModalBody,
    ModalCloseButton,
  } from "@chakra-ui/react";

  const SintomasModal = ({ isOpen, onClose }) => {

    return (
      <>
        <Modal isOpen={isOpen} onClose={onClose}>
          <ModalOverlay />
          <ModalContent>
            <ModalHeader>Cadastro de Paciente</ModalHeader>
            <ModalCloseButton />
            <ModalBody>
                <h1>{props.doenca}</h1>

            </ModalBody>
            <ModalFooter justifyContent="start">
            </ModalFooter>
          </ModalContent>
        </Modal>
      </>
    );
  };

  export default SintomasModal;
